bool validPalindrome (std::string s) {
    // int flag = 1;
    std::string new_s1, new_s2;
    for(int i = 0; i < s.size(); i++){
        if(s[i] != s[s.size() - 1 - i]){
            // flag--;
            // char s1 = s[i];
            new_s1 = s.substr(i + 1, s.length() - 2 * i - 1);
            std::cout << new_s1 << std::endl;
            // char s2 = s[s.length() - i - 1];
            new_s2 = s.substr(i, ((s.length() - 2 * i) - 1));
            std::cout << new_s2 << std::endl;
            return palinHelper(new_s1) or palinHelper(new_s2);
        }
    }
    return true;
}

